(* ::Subsection:: *)
(*Spin Parameterizations*)


(* ::Input::Initialization:: *)
sTotR[\[Eta]_,\[Chi]1_,\[Chi]2_] := Module[{m1,m2},
(*
	- Mass weighted effective total spin parameter.
*)

m1 = 1/2 (1+Sqrt[1-4 \[Eta]]);
m2 = 1/2 (1-Sqrt[1-4 \[Eta]]);

(m1^2 \[Chi]1 + m2^2 \[Chi]2)/(m1^2 + m2^2)
];


\[Chi]PN[\[Eta]_,\[Chi]1_,\[Chi]2_]:=Module[{\[Delta],\[Chi]efftmp},
(*
	- This is the "reduced spin" parameter 
	- Post-Newtonian effective spin parameter.
	- Conventions assume that m1 > m2 with Subscript[\[Chi], i] belonging to body i
	- https://arxiv.org/abs/1107.1267
	- https://arxiv.org/abs/1508.07250
	- https://arxiv.org/abs/1508.07253
*)

\[Delta]       = Sqrt[1 - 4\[Eta]];
\[Chi]efftmp = 1/2 (1+\[Delta])\[Chi]1 + 1/2 (1-\[Delta])\[Chi]2;
\[Chi]efftmp - (76/113)(1/2)(\[Chi]1+\[Chi]2)\[Eta]
];


\[Chi]PNhat[\[Eta]_,\[Chi]1_,\[Chi]2_]:=Module[{\[Delta]},
(*
	- Normalised Subscript[\[Chi], PN] that that lies \[Epsilon] [-1,1].
	- Conventions assume that m1 > m2 with Subscript[\[Chi], i] belonging to body i
*)

\[Chi]PN[\[Eta],\[Chi]1,\[Chi]2] / (1 - (76 \[Eta] / 113))
];


